import logo from './logo.svg';
import './App.css';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
import AboutMe from '../src/MainPages/AboutMe'
import BlogPosts from '../src/MainPages/BlogPosts'
import ContactMe from '../src/MainPages/ContactMe'
import Home from '../src/MainPages/Home'
import UploadPost from '../src/MainPages/UploadPost'
import Post from '../src/MainPages/Post'
export const Routes = () => {
  return (
      <Switch>
          <div>
              <Route path="/" exact component={Home} />
              <Route path="/blogs" exact component={BlogPosts} />
              <Route path="/aboutMe" exact component={AboutMe} />
              <Route path="/contactMe" exact component={ContactMe} />
              <Route path="/uploadPost" exact component={UploadPost} />
              <Route path="/post/:id" exact component={Post} />

          </div>
      </Switch>
  )
}

export const App = () => {
  return (
      <Router>
          <Routes />
      </Router>
  )
}

export default App
